  \"Terrain data, as defined in FEMA Guidelines and Specifications, Appendix M: Data
  Capture Standards, describe the digital topographical data that were used to create
  the elevation data representing the terrain environment of a watershed and/or floodplain.
  Terrain data requirements allow for flexibility in the types of information provided
  as sources used to produce the final terrain deliverables. Once this type of data
  is provided, FEMA will be able to account for the origins of the flood study elevation
  data (Source: FEMA Guidelines and Specifications, Appendix M, Section N.1.2)\",\n\t\"license_title\":
